import React, { useState } from 'react';
import models from './data/models.json';
import LeftSidebar from './components/LeftSidebar';
import RightSidebar from './components/RightSidebar';
import Layout from './components/Layout';

export default function App() {
  const [selectedModel, setSelectedModel] = useState(null);
  const [selectedKeyword, setSelectedKeyword] = useState(null);

  const handleModelSelect = (model) => {
    setSelectedModel(model);
    setSelectedKeyword(null); // Clear selected keyword when a model is selected
  };

  const handleKeywordClick = (keyword) => {
    setSelectedKeyword(keyword);
    setSelectedModel(null); // Clear selected model when a keyword is clicked
  };

  return (
    <Layout
      header={<h1 style={{ fontFamily: 'Montserrat, sans-serif', fontWeight: '600', color: '#333333' }}>Conceptual Models Explorer</h1>}
      leftSidebar={
        <LeftSidebar
          models={models}
          selectedModel={selectedModel}
          onKeywordClick={handleKeywordClick}
        />
      }
      main={
        <div
          style={{
            padding: '2rem',
            fontFamily: 'Fira Sans Extra Condensed, sans-serif',
            fontWeight: '300',
            color: '#333333',
          }}
        >
          {selectedModel ? (
            <>
              <h2
                style={{
                  fontFamily: 'Montserrat, sans-serif',
                  fontWeight: '600',
                  color: '#333333',
                  marginBottom: '1rem',
                }}
              >
                {selectedModel.name}
              </h2>
              <table
                style={{
                  width: '100%',
                  borderCollapse: 'collapse',
                  fontSize: '1rem',
                  backgroundColor: '#FFFFFF',
                  color: '#333333',
                }}
              >
                <tbody>
                  <tr>
                    <td
                      style={{
                        padding: '0.5rem',
                        fontWeight: '500', // Medium weight for labels
                        backgroundColor: '#F8F8F8',
                        border: '1px solid #D3D3D3',
                      }}
                    >
                      Description
                    </td>
                    <td
                      style={{
                        padding: '0.5rem',
                        fontWeight: '300', // Light weight for content
                        border: '1px solid #D3D3D3',
                      }}
                    >
                      {selectedModel.description}
                    </td>
                  </tr>
                  <tr>
                    <td
                      style={{
                        padding: '0.5rem',
                        fontWeight: '500',
                        backgroundColor: '#F8F8F8',
                        border: '1px solid #D3D3D3',
                      }}
                    >
                      Citation
                    </td>
                    <td
                      style={{
                        padding: '0.5rem',
                        fontWeight: '300',
                        border: '1px solid #D3D3D3',
                      }}
                    >
                      {selectedModel.citation}
                    </td>
                  </tr>
                  <tr>
                    <td
                      style={{
                        padding: '0.5rem',
                        fontWeight: '500',
                        backgroundColor: '#F8F8F8',
                        border: '1px solid #D3D3D3',
                      }}
                    >
                      Reference
                    </td>
                    <td
                      style={{
                        padding: '0.5rem',
                        fontWeight: '300',
                        border: '1px solid #D3D3D3',
                      }}
                    >
                      {selectedModel.reference}
                    </td>
                  </tr>
                  <tr>
                    <td
                      style={{
                        padding: '0.5rem',
                        fontWeight: '500',
                        backgroundColor: '#F8F8F8',
                        border: '1px solid #D3D3D3',
                      }}
                    >
                      Link
                    </td>
                    <td
                      style={{
                        padding: '0.5rem',
                        fontWeight: '300',
                        border: '1px solid #D3D3D3',
                      }}
                    >
                      <a
                        href={selectedModel.url}
                        target="_blank"
                        rel="noopener noreferrer"
                        style={{
                          color: '#1E88E5',
                          textDecoration: 'none',
                          fontWeight: '300',
                        }}
                      >
                        View Source
                      </a>
                    </td>
                  </tr>
                  <tr>
                    <td
                      style={{
                        padding: '0.5rem',
                        fontWeight: '500',
                        backgroundColor: '#F8F8F8',
                        border: '1px solid #D3D3D3',
                      }}
                    >
                      Keywords
                    </td>
                    <td
                      style={{
                        padding: '0.5rem',
                        fontWeight: '300',
                        border: '1px solid #D3D3D3',
                      }}
                    >
                      {selectedModel.keywords.join(', ')}
                    </td>
                  </tr>
                </tbody>
              </table>
            </>
          ) : (
            <p
              style={{
                textAlign: 'center',
                padding: '2rem',
                fontFamily: 'Fira Sans Extra Condensed, sans-serif',
                fontWeight: '300',
                color: '#333333',
              }}
            >
              Please select a model to view its details.
            </p>
          )}
        </div>
      }
      rightSidebar={
        <RightSidebar
          models={models}
          selectedModel={selectedModel}
          selectedKeyword={selectedKeyword}
          onSelectModel={handleModelSelect}
        />
      }
      footer={<p style={{ fontFamily: 'Fira Sans Extra Condensed, sans-serif', fontWeight: '300', color: '#333333' }}>Footer Content</p>}
    />
  );
}
